### What version of sky-walking are you using?
(the latest version of sky-walkiing) + druid-1.0.17.jar + mysql-connector-java-5.1.13.jar
----------------------------------------------------

When druid database source init, he will validate every connection he create. He invoke method  **pingInternal** in **com.mysql.jdbc.MySQLConnection** as default.But using sky-walking,the connection is proxy by **org.skywalking.apm.plugin.jdbc.SWConnection**,then druid execute the below code has different result.
// clazz == com.mysql.jdbc.MySQLConnection
// conn == org.skywalking.apm.plugin.jdbc.SWConnection
     clazz.isAssignableFrom(conn.getClass())
>>>>>>>>>>>>>>>>>>>>>>>>>>>>>>
也就是说druid框架在检测数据库连接时想用到MySQLConnection的特有方法，导致程序有点不兼容，不使用ping方法检查连接。刚才druid-1.0.17的检测sql为空报错，之后的版本都有默认的sql。
我想问一下，有没有什么办法从sky-walking框架层次来解决这个问题，尽可能兼容已有的应用，同时不想增加对mysql-connector-java包的依赖。目前SWConnection只是java.sql.Connection的子类，没想到特别好的方法。

其他解决方法：其实可以升级druid框架或者增加检测sql="select 1"解决问题。
 >>>>>>>>>>>>>>>>>>>>>>>>>>>>>  

        ` if (usePingMethod) {
            if (conn instanceof DruidPooledConnection) {
                conn = ((DruidPooledConnection) conn).getConnection();
            }
            if (conn instanceof ConnectionProxy) {
                conn = ((ConnectionProxy) conn).getRawObject();
            }
            if (clazz.isAssignableFrom(conn.getClass())) {
                if (validationQueryTimeout < 0) {
                    validationQueryTimeout = DEFAULT_VALIDATION_QUERY_TIMEOUT;
                }
                try {
                    ping.invoke(conn, true, validationQueryTimeout);
                    return true;
                } catch (InvocationTargetException e) {
                    Throwable cause = e.getCause();
                    if (cause instanceof SQLException) {
                        return false;
                    }
                    LOG.warn("Unexpected error in ping", e);
                    return false;
                } catch (Exception e) {
                    LOG.warn("Unexpected error in ping", e);
                    return false;
                }
            }
        }`
